INSERT INTO `b_article_detail` VALUES ('17', '26', '## 啊实打实大声道阿萨德阿萨德阿萨德阿萨德');
INSERT INTO `b_article_detail` VALUES ('19', '32', '微凉的晨露沾湿黑礼服， 石板路有雾父在低诉\n\n无奈的觉悟只能更残酷， 一切都为了通往圣堂的路\n\n吹不散的雾隐没了意图， 谁轻柔踱步停住\n\n还来不及哭穿过的子弹就带走温度， 我们每个人都有罪\n\n犯着不同的罪， 我能决定谁对\n\n谁又该要7a64e78988e69d8331333431346366沉睡， 争论不能解决\n\n在永无止境的夜， 关掉你的嘴\n\n唯一的恩惠， 挡在前面的人都有罪\n\n后悔也无路可退， 以父之名判决\n\n那感觉没有适合词汇， 就像边笑边掉泪\n\n凝视着完全的黑， 阻挡悲剧蔓延的悲剧会让我沉醉\n\n低头亲吻我的左手， 换取被宽恕的承诺\n\n老旧管风琴在角落， 一直一直一直伴奏\n\n黑色帘幕被风吹动， 阳光无言地穿透\n\n洒向那群被我驯服后的兽， 沉默地喊叫沉默地喊叫\n\n孤单开始发酵， 不停对着我嘲笑\n\n回忆逐渐燃烧， 曾经纯真的画面\n\n残忍地温柔出现， 脆弱时间到\n\n我们一起来祷告， 仁慈的父我已坠入\n\n看不见罪的国度， 请原谅我的自负\n\n没人能说没人可说， 好难承受\n\n荣耀的背后刻着一道孤独， 闭上双眼我又看见\n\n当年那梦的画面， 天空是蒙蒙的雾\n\n父亲牵着我的双手， 轻轻走过\n\n清晨那安安静静的石板路， 低头亲吻我的左手\n\n换取被宽恕的承诺， 老旧管风琴在角落\n\n一直一直一直伴奏， 黑色帘幕被风吹动\n\n阳光无言地穿透， 洒向那群被我驯服后的兽\n\n沉默地喊叫沉默地喊叫， 孤单开始发酵\n\n不停对着我嘲笑， 回忆逐渐燃烧\n\n曾经纯真的画面， 残忍地温柔出现\n\n脆弱时间到， 我们一起来祷告');
INSERT INTO `b_article_detail` VALUES ('21', '2', '1222、学习目标：所谓“学习目标”就是你想学习的知识领域，想掌握什么样的技能。在学习这个层面，“目标”非常重要，如果没有明确的目标，就不能对目标进行持续化的管理，是很难实现梦想的。像唐僧西天取经一般，要有“历经万难也不放弃”的毅力。无论你的学习能力有多强，方法论有多高深，这都不一定能让你实现目标。水滴石穿地坚定目标，才有可能抵达理想的彼岸。\n\n2、知识框架：任何一个领域的知识，都有一套复杂的知识框架，横向的、纵向的，你必须给自己制定一套科学的由浅入深的学习路径。这套框架，必须始终印在我们的脑海里，一步一个脚印地向前学习，万里长城也需要一步一个台阶地攀登。\n\n3、学习方法：我推荐的学习方法是“知识可视化”+“主动实践”。所谓“知识可视化”，是指把复杂的知识转化成可见的、易理解的、易记忆的图形图像。所谓“主动实践”，是指学以致用，多做多练习多总结。\n12');
